import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import HeaderSection from './HeaderSection';
import ServiceList from './ServiceList';
import CarImage from './CarImage';

const ServicesLayout = () => {
  return (
    <div className="d-flex flex-column flex-lg-row" style={{ width: '100%', minHeight: '100vh' }}>
      {/* Car Image Section */}
      <div className="d-flex justify-content-center align-items-center flex-grow-1" style={{ position: 'relative' }}>
        <img src="https://dashboard.codeparrot.ai/api/image/Z7kBNVCHtJJZ6v_o/vector.png" alt="Background Shape" style={{ position: 'absolute', width: '100%', height: 'auto', zIndex: 1 }} />
        <CarImage style={{ zIndex: 2 }} />
      </div>

      {/* Content Section */}
      <div className="d-flex flex-column flex-grow-1 justify-content-center" style={{ padding: '40px' }}>
        <HeaderSection />
        <ServiceList />
      </div>
    </div>
  );
};

export default ServicesLayout;
